        <p>Calgary, AB</p>
        <p>Phone: 825-437-8441</p>
        <p>Email: rmxali2003@gmail.com</p>
      </header>

      {/* The rest of your profile and resume sections */}
      {/* ... */}
    </div>
  );
};

export default Home;
